INSERT INTO `help` (`help_id`, `function_name`, `help_name`, `help_description`) VALUES
(1, 'Assessment', 'General', '1) Assessement page contains list of all the assessees under particular assessor.<br>\r\n2) For every assessee it will show the assessment status, assessment and feedback link.<br>\r\n3) On clicking assessment link assessor is redirected to assessment form of particular assessee.<br>\r\n4) On the assessement form assessor can fill the score and remark against goals of the assessee.<br>\r\n5) Assessor can save or complete the assessement by clicking ''Save'' or ''Complete'' buttons respectively.<br>\r\n6) Assessor can click on the feedback link and select particular  person to get the feedback about the assessee.<br>\r\n7) Assessor can click on ''Submit'' button to finally submit assessment.<br><br>\r\nNote: Appraisal will not be passed to next phase unless and until submitted.\r\n'),
(2, 'Assessment', 'Save', '1) While doing the assessment assessor can save partially filled data by clicking ''Save'' button.<br>\r\n2) Status of assessment will not be changed and user can still edit the contents.<br> 3) System will show assessment weighted score at the bottom.'),
(3, 'Assessment', 'Complete', '1) While doing the assessment once data is completely filled or final for particular assessee, user can  click ''Complete'' button.<br>\r\n2) On clicking ''Complete'' system will check whether all the fields are filled or not.<br>\r\n3) If data is not completely filled system will give appropriate error message else if all the data is filled system will ask for confirmation.<br>\r\n4) If assessor selects ''cancel'' assessor can continue with assessment else if assessor selects ''ok'' , assessment status will now be changed to ''done'' and user can not edit the contents of that assessee any more.<br>\r\n5) Assessor is redirected to first page where system will show final assessment weighted score.'),
(4, 'Assessment', 'Submit', '1) While doing the assessment assessor can submit the assessment by clicking ''Submit'' button.<br>\r\n2) On clicking ''Submit'' system will check whether all assessee''s assessment status is ''done''.<br>\r\n3) If all assessments are done system will ask for confirmation.<br>\r\n4) If assessor selects ''cancel'' assessor can continue with assessment else if assessor selects ''ok'' , assessment status will now be changed to ''completed'' and user can not edit the contents of any assessee. '),
(6, 'Review', 'General', '1) Review page contains list of all the assessees under particular reviewer.<br>\r\n2) For every assessee it will show the review status and review link.<br>\r\n3) On clicking review link reviewer is redirected to review form of particular assessee.<br>\r\n4) On the review form reviewer can fill the score and remark against goals of the assessee.<br>\r\n5) Reviewer can save or complete the review by clicking ''Save'' or ''Complete'' buttons respectively.<br>\r\n6) Reviewer can click on ''Submit'' button to finally submit review.<br><br>\r\nNote: Appraisal will not be passed to next phase unless and until submitted.'),
(7, 'Review', 'Save', '1) While doing the review reviewer can save partially filled data by clicking ''Save'' button.<br>\r\n2) Status of review will not be changed and user can still edit the contents.<br>\r\n3) System will show review weighted score at the bottom.'),
(8, 'Review', 'Complete', '1) While doing the review once data is completely filled or final for particular assessee, user can  click ''Complete'' button.<br>\r\n2) On clicking ''Complete'' system will check whether all the fields are filled or not.<br>\r\n3) If data is not completely filled system will give appropriate error message else if all the data is filled system will ask for confirmation.<br>\r\n4) If reviewer selects ''cancel'' reviewer can continue with review else if reviewer selects ''ok'' , review status will now be changed to ''done'' and user can not edit the contents of that assessee any more.<br>\r\n5) Reviewer is redirected to first page where system will show final review weighted score.'),
(9, 'Review', 'Submit', '1) While doing the review reviewer can submit the review by clicking ''Submit'' button.<br>\r\n2) On clicking ''Submit'' system will check whether all reviewer''s review status is ''done''.<br>\r\n3) If all review are done system will ask for confirmation.<br>\r\n4) If reviewer selects ''cancel'' reviewer can continue with review else if reviewer selects ''ok'' , review status will now be changed to ''completed'' and user can not edit the contents of any review. '),
(10, 'Assessment Confirmation', 'Assessment Confirmation', 'AssessmentConfirmation'),
(11, 'Manager Appraisal Snapshot', 'Manager Appraisal Snapshot', 'ManagerAppraisalSnapshot'),
(13, 'Change Password', 'Change Password', '<div style=''background:#E6EFC2;''>\r\n\r\n\r\n\r\n<h4>Password Recovery help menu -</h4> \r\n\r\n<ul>\r\n\r\n  <li>Password : Enter your old password</li>\r\n\r\n  <li>New password : Enter your new password</li>\r\n\r\n  <li>Retype password : Retype password and new password must be equal</li>\r\n\r\n</ul>  \r\n\r\n\r\n\r\n</div>'),
(14, 'Forgot Password', 'Forgot Password', 'Forgot Password'),
(15, 'Employee Grade Records', 'Employee Grade Records', 'Employee Grade Records'),
(16, 'Appraisal Snapshot', 'Appraisal Snapshot', 'Appraisal Snapshot'),
(17, 'Initate Goal Setting Mails', 'Initate Goal Setting Mails', 'Initate Goal Setting Mails'),
